pragma solidity ^0.4.17;

import "../base/IbaseLib.sol";
import "../base/owned.sol";
import "../base/timestamped.sol";
import "../base/mortal.sol";
import "../timeline/Timeline.sol";

/**
 * Base contract for representing a Timeline based chain asset.
 *
 * Copyright (c) 2018 Cognate, Inc.
 */
contract Asset is timestamped, owned(msg.sender), mortal {
    Timeline public timeline;

    constructor(bytes _timeline) public {
        if (_timeline.length > 0) {
            timeline = Timeline(IbaseLib.createContractFromBytes(_timeline));
        }
    }

    /**
     * Upgrade the controlling timeline of this trademark smart asset.
     */
    function upgradeTimeline(bytes _timeline) public onlyOwner {
        Timeline previous = timeline;
        timeline = Timeline(IbaseLib.createContractFromBytes(_timeline));

        if(previous != address(0)) {
            previous.upgrade(timeline);
        }
    }
}
